  `isback` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '是否归还',
  `backtime` date NULL DEFAULT NULL COMMENT '归还时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2345678919 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = DYNAMIC;

