-- ----------------------------
-- Procedure structure for borrow_procedure
-- ----------------------------
DROP PROCEDURE IF EXISTS `borrow_procedure`;
delimiter ;;
CREATE PROCEDURE `borrow_procedure`()
begin
UPDATE borrow SET money=money+0.1 WHERE DATEDIFF(CURDATE(),endtime) >0 and isback = 0;
end
;;
delimiter ;

